        public static BusinessAddress ParseAddress(string line)
        {
            string[] addressParts = line.Split('\t');

            return new()
            {
                BuildingName = addressParts[10],
                SubBuildingName = addressParts.Length > 1 ? addressParts[11] : string.Empty,
                BuildingNumber = addressParts.Length > 2 ? addressParts[12] : string.Empty,
                Street = addressParts.Length > 3 ? addressParts[13] : string.Empty,
                Town = addressParts.Length > 4 ? addressParts[16] : string.Empty,
                County = addressParts.Length > 5 ? addressParts[17] : string.Empty,
                Country = addressParts.Length > 6 ? addressParts[18] : string.Empty,
                PostCode = addressParts.Length > 7 ? addressParts[19] : string.Empty
            };
        }
    }

